import { Table, Pagination, Button, Col, Row } from "react-bootstrap";
import { Link } from "react-router-dom";
import React, { useState } from "react";

const Accounts = () => {
  const [transactions, setTransactions] = useState([
    {
      address: "addressOne",
      eth: 1,
      catCoin: 1,
      babyCoin: 4,
    },
    {
      address: "addressTwo",
      eth: 4,
      catCoin: 2,
      babyCoin: 4,
    },
  ]);

  const [items, setItems] = useState([]);

